export const ArrayBar = ({number}) => {
    const StyledArrayBar = styled.div`
    display: flex;
    margin: 5px 5px;
    width: 10px;
    height: 10px;
    background-color: skyblue;
    `

    return (   
        <div>
            <StyledArrayBar number = {number} style={{height: `${number}px`}}>
            </StyledArrayBar> 
        </div>
    )
}

export const Section = styled.div`
    display: flex;


`
